	const tree = (data, optionKeys = {}) => {
		const { parentKey = "parent", valueKey = "id", childrenKey = "children" } = optionKeys;
		const array = [];
		const map = {};

		for (let key in data) {
			const item = data[key];
			const value = item[valueKey];

			if (!value) {
				continue;
			}

			if (map[value]) {
				item[childrenKey] = map[value];
			}
			else {
				item[childrenKey] = map[value] = [];
			}

			if (item[parentKey]) {
				const parentId = item[parentKey];

				if (!map[parentId]) {
					map[parentId] = [];
				}

				map[parentId].push(item);
			}
			else {
				array.push(item);
			}
		}

		return array;
	};

	const getCountis = (districts) => {
		const transform = list => {
			let array = [];

			list.forEach(item => {
				let target = {
					value: item.id,
					label: item.name
				};

				if (item.children && item.children.length > 0) {
					const children = transform(item.children);

					if (children.length > 0) {
						target.children = transform(item.children);
					}
				}

				array.push(target);
			});

			return array;
		};

		return transform(districts);
	};

	export default {
		components: {
			VuiDocExample
		},
		data() {
			return {
				code,
				value: [],
				options: getCountis(tree(districts)),
				valueKey: "value",
				childrenKey:"children",
				title: props => props.direction === "source" ? (props.level === 1 ? "行为类目词" : props.parent.label) : "已选",
				formatter: props => props.option.label,
				showTargetPanel: true,
				validator: false
			};
		},
